import React, { useEffect } from 'react';
import { type } from 'os';

const Home: React.FC = () => {
  type Person = {
    eyes: string;
    numberOfEyes: number;
    isTall: boolean;
  };

  const Joe: Person = {
    eyes: 'Brown',
    numberOfEyes: 2,
    isTall: true,
  };

  console.log(Joe);

  return <h1>Hello World</h1>;
};

export default Home;
